import React from "react";


export default function List(props){ 
   console.log(props.data);
    return(
        <div>
            {props.data.map(item => (
                <ul>
                    <li>
                        <p>{item.id}.  {item.title} </p><button>Edit</button> 
                    </li>
                </ul>
            )
            )}   
        </div>
    );
};
